import PropTypes from "prop-types";

import "./Grid.scss";

function Grid(props) {
  return (
    <div className="grid">
      <div>11234124</div>
      <div>2</div>
      <div>321414</div>
      <div>4</div>
      <div>5</div>
    </div>
  );
}

Grid.propTypes = {};

export default Grid;
